import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
    <input disabled={this.getDisabled(cell)} className="sqr" type="text" size="1" maxLength="1" required
  style={this.getDisabled(cell) ? {backgroundColor : 'black'} : {backgroundColor : 'ivory'}}
/>

  <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
